    // componentDidMount(){
    //     fetch{'https://pokeapi.co/api/v2/pokemon/'}.then(response=> {
    //        return response.json();
    //     })
    //     .then(characters=> {
    //         this.setState({pokemons: characters})
    //     });
    // }
    
    return (
        <div>
            <h1>Pokemon Team strength</h1>
            <p>All you need resource for pokemon information</p>
            <PanelList pokedex={pokedex}/>
        </div>
    );

}

export default Appapi;
